import React from "react";
import { Link } from "react-router-dom";
import "../../src/styles/navbar.css";
import "../styles/profile-tab.css"
const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="left-section">
        <div className="profile-tab">        <Link to="/profile-creation" >Profile Creation</Link>
        </div>
        <div className="recommendations-tab">        <Link to="/recommendations">Recommendations</Link>
        </div>
      </div>
      <div className="nav-right">
        
        <Link to="/create-account">Sign Up/In</Link>
      </div>
    </nav>
  );
};

export default Navbar;
